var grobjects = grobjects || [];

var Birdsnest = undefined;

(function(){
  "use strict";
  var shaderProgram = undefined;
  var buffers = undefined;
  var image = new Image();
  Birdsnest = function Birdsnest(position, size){
    this.name = "Bird's Net";
    this.position = position || [0,0,0];
    this.size = size || 1.0;
  }
  Birdsnest.prototype.init = function(drawingState){
    var gl = drawingState.gl;
    if(!shaderProgram){
      shaderProgram = twgl.createProgramInfo(gl, ["birdsnest-vs", "birdsnest-fs"]);
    }

    if(!buffers){
      var v = new Array();
      var n = new Array();
      var t = new Array();
      var net = LoadedOBJFiles["Birdsnest.obj"].groups;
      for(var i =0; i <300; i++){
        var parts = net[Object.keys(net)[i]];
        if(parts == undefined){
          break;
        }
        var faces = parts.faces;
        var ver = parts.vertices;
        var tex = parts.texCoords;
        var nor = parts.normals;
        for(var j=0; j<faces.length;j++){
          var face = faces[j];
          for(var k =0; k<face.length;k++){
            var vt = ver[face[k][0]];
            var tt = tex[face[k][1]];
            var nt = nor[face[k][2]];
            //console.log("b4 log "+i+" "+j+" "+k);
            if(twgl.v3.dot([0,1,0],nt)<0){
               nt = twgl.v3.negate(nt);
               //console.log(i+" "+j+" "+k);
            }
            if(tt==undefined){
              tt=[0,0];
            }
            v.push(vt[0]);
            v.push(vt[1]);
            v.push(vt[2]);
            t.push(tt[0]);
            t.push(tt[1]);
            n.push(nt[0]);
            n.push(nt[1]);
            n.push(nt[2]);
          }
        }
      }
      var arrays = {
        vPosition : { numComponents: 3, data: v },
        vNormal : { numComponents: 3, data: n },
        vTexCorrd: { numComponents: 2, data: t}
      }
      buffers = twgl.createBufferInfoFromArrays(gl,arrays);
      gl.useProgram(shaderProgram.program);
      shaderProgram.program.uTexture = gl.getUniformLocation(shaderProgram.program, "uTexture");
      gl.uniform1i(shaderProgram.program.uTexture, 0);
      var texture = gl.createTexture();
      gl.bindTexture(gl.TEXTURE_2D, texture);
      gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, 1, 1, 0, gl.RGBA, gl.UNSIGNED_BYTE, null);
      initTextureThenDraw(gl,texture);
    }
  };

  Birdsnest.prototype.draw = function(drawingState) {
    var modelM = twgl.m4.scaling([this.size/100000,this.size/100000,this.size/100000]);
    twgl.m4.setTranslation(modelM,this.position,modelM);
    var gl = drawingState.gl;
    gl.useProgram(shaderProgram.program);
    twgl.setBuffersAndAttributes(gl,shaderProgram,buffers);
    twgl.setUniforms(shaderProgram,{
        view:drawingState.view, proj:drawingState.proj, lightdir:drawingState.sunDirection,
        lightColor:drawingState.sunColor, model: modelM});
    twgl.drawBufferInfo(gl, gl.TRIANGLES, buffers);
  };
  Birdsnest.prototype.center = function(drawingState){
    return this.position;
  }

  function LoadTexture(gl,texture){
    gl.bindTexture(gl.TEXTURE_2D, texture);
    gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, image);
    gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.CLAMP_TO_EDGE);
    gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.CLAMP_TO_EDGE);
    gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR);
  };

  function initTextureThenDraw(gl,texture)
  {
  	image.crossOrigin = "anonymous";
  	image.src = "data:image/jpeg;base64,";
    image.onload = function(){
      LoadTexture(gl,texture);
    }

  	window.setTimeout(console.log("TIMEOUT"), 500);
  }
})();


grobjects.push(new Birdsnest([-15,0.02,-15],6.0));
